import "./customButton.styles.scss";

const CustomButton = ({ children, isGoogleSignIn, ...otherProps }) => {
  return (
    <button
      className={isGoogleSignIn ? "custom-button--blue" : ""}
      custom-button
      {...otherProps}
    >
      {children}
    </button>
  );
};

export default CustomButton;
